module.exports = "<mat-card class=\"mat-typography\">\n    <h1>Sobre o Insit</h1>\n\n<!--\n    <p> Atualmente, a Prefeitura da Cidade do Rio de Janeiro (PCRJ) estrutura-se em 12 Secretarias Executivas, a Controladoria Geral, \n        a Procuradoria Geral e o Gabinete do Prefeito. Todos esses órgãos têm seus próprios sistemas de gestão de informação que agregam, \n        potencialmente dados e informação necessários para um gestão eficiente. Entretanto, esses sistemas não se integram e eventualmente \n        apresentam informações incompletas ou mesmo inconsistentes o que prejudica sobremaneira o processo de tomada de decisão do Prefeito\n        e de seus secretários.</p>\n-->\n    \n    <p> Este processo de tomada de decisão, para ser ótimo e efetivo, necessita dispor de uma ferramenta integrada de apoio à operações que\n        congregue e integre dados atuais e confiáveis em um sistema único de inteligência.</p>\n    \n    <p> Desta forma, a fim de mitigar essa deficiência, faz-se necessário a adoção de um sistema integrado de Inteligência Situacional</p>\n\n</mat-card>"

